import React from 'react'
import { Link } from 'react-router-dom'
import "./ListProject.css"

const ListProject = ({ project: project }) => {
    return (
        <Link to={`/project/${project.id}`}>
            <div className="list-item" >
                <h3>Project</h3>
            </div>

        </Link>
    )
}

export default ListProject
